import React from 'react';
import { Card, CardMedia, CardContent, CardActions, Button, Typography } from '@mui/material';

import resortLogo from '../../images/heavenly.png';


export default function Resorts(props) {
   return (
      <ul>
         {props.liftieData.map(resort => {
            return <li key={resort.skimapID}>
               <Card sx={{ maxWidth: 345 }}>
                  <CardMedia
                     component='img'
                     height='140'
                     image={resortLogo}
                     alt="ski resort logo"
                  />
                  <CardContent>
                     <Typography gutterBottom variant='h3' component='div'>
                        {resort.skimapID}
                     </Typography>
                  </CardContent>
               </Card>
            </li>
         })}
      </ul>
   )
}
